(153, 'C', '13', '137', '1371', '蔬菜加工', '', 1),
(154, 'C', '13', '137', '1372', '水果和坚果加工', '', 1),
(155, 'C', '13', '139', '139', '其他农副食品加工  ', '', 1),
(156, 'C', '13', '139', '1391', '淀粉及淀粉制品制造', '指用玉米、薯类、豆类及其他植物原料制作淀粉和淀粉制品的生产；还包括以淀粉为原料，经酶法或酸法转换得到的糖品生产活动', 1),
(157, 'C', '13', '139', '1392', '豆制品制造', '指以大豆、小豆、绿豆、豌豆、蚕豆等豆类为主要原料，经加工制成食品的活动', 1),
(158, 'C', '13', '139', '1393', '蛋品加工      ', '', 1),
(159, 'C', '13', '139', '1399', '其他未列明农副食品加工  ', '', 1),
(160, 'C', '14', '14', '14', '食品制造业', '', 1),
(161, 'C', '14', '141', '141', '焙烤食品制造', '', 1),
(162, 'C', '14', '141', '1411', '糕点、面包制造', '指用米粉、面粉、豆粉为主要原料，配以辅料，经成型、油炸、烤制而成的各种食品生产活动', 1),
(163, 'C', '14', '141', '1419', '饼干及其他焙烤食品制造', '指以面粉（或糯米粉）、糖和油脂为主要原料，配以奶制品、蛋制品等辅料，经成型、焙烤制成的各种饼干，以及用薯类、谷类、豆类等制作的各种易于保存、食用方便的焙烤食品生产活动', 1),
(164, 'C', '14', '142', '142', '糖果、巧克力及蜜饯制造', '', 1),
(165, 'C', '14', '142', '1421', '糖果、巧克力制造', '糖果制造指以砂糖、葡萄糖浆或饴糖为主要原料，加入油脂、乳品、胶体、果仁、香料、食用色素等辅料制成甜味块状食品的生产活动；巧克力制造指以浆状、粉状或块状可可、可可脂、可可酱、砂糖、乳品等为主要原料加工制成巧克力及巧克力制品的生产活动', 1),
(166, 'C', '14', '142', '1422', '蜜饯制作', '指以水果、坚果、果皮及植物的其他部分制作糖果蜜饯的活动', 1),
(167, 'C', '14', '143', '143', '方便食品制造', '指以米、面、杂粮等为主要原料加工制成，只需简单烹制即可作为主食，具有食用简便、携带方便，易于储藏等特点的食品制造', 1),
(168, 'C', '14', '143', '1431', '米、面制品制造', '指以米、面、杂粮等为原料，经粗加工制成，未经烹制的各类米面制品的生产活动', 1),
(169, 'C', '14', '143', '1432', '速冻食品制造', '指以米、面、杂粮等为主要原料，以肉类、蔬菜等为辅料，经加工制成各类烹制或未烹制的主食食品后，立即采用速冻工艺制成的，并可以在冻结条件下运输储存及销售的各类主食食品的生产活动', 1),
(170, 'C', '14', '143', '1439', '方便面及其他方便食品制造', '指用米、面、杂粮等为主要原料加工制成的，可以直接食用或只需简单蒸煮即可作为主食的各种方便主食食品的生产活动，以及其他未列明的方便食品制造', 1),
(171, 'C', '14', '144', '1440', '乳制品制造', '指以生鲜牛（羊）乳及其制品为主要原料，经加工制成的液体乳及固体乳（乳粉、炼乳、乳脂肪、干酪等）制品的生产活动；不包括含乳饮料和植物蛋白饮料生产活动', 1),
(172, 'C', '14', '145', '145', '罐头食品制造', '指将符合要求的原料经处理、分选、修整、烹调（或不经烹调）、装罐、密封、杀菌、冷却（或无菌包装）等罐头生产工艺制成的，达到商业无菌要求，并可以在常温下储存的罐头食品的制造', 1),
(173, 'C', '14', '145', '1451', '肉、禽类罐头制造', '', 1),
(174, 'C', '14', '145', '1452', '水产品罐头制造', '', 1),
(175, 'C', '14', '145', '1453', '蔬菜、水果罐头制造', '', 1),
(176, 'C', '14', '145', '1459', '其他罐头食品制造', '指婴幼儿辅助食品类罐头、米面食品类罐头（如八宝粥罐头等）及上述未列明的罐头食品制造', 1),
(177, 'C', '14', '146', '146', '调味品、发酵制品制造', '', 1),
(178, 'C', '14', '146', '1461', '味精制造', '指以淀粉或糖蜜为原料，经微生物发酵、提取、精制等工序制成的，谷氨酸钠含量在80％及以上的鲜味剂的生产活动', 1),
(179, 'C', '14', '146', '1462', '酱油、食醋及类似制品制造', '指以大豆和（或）脱脂大豆，小麦和（或）麸皮为原料，经微生物发酵制成的各种酱油和酱类制品，以及以单独或混合使用各种含有淀粉、糖的物料或酒精，经微生物发酵酿制的酸性调味品的生产活动', 1),
(180, 'C', '14', '146', '1469', '其他调味品、发酵制品制造', '', 1),
(181, 'C', '14', '149', '149', '其他食品制造', '', 1),
(182, 'C', '14', '149', '1491', '营养食品制造', '指主要适宜伤残者、老年人，含肉、鱼、水果、蔬菜、奶、麦精、钙等均质配料的营养食品的生产活动', 1),
(183, 'C', '14', '149', '1492', '保健食品制造', '指标明具有特定保健功能的食品，适用于特定人群食用，具有调节机体功能，不以治疗为目的，对人体不产生急性、亚急性或慢性危害，以补充维生素、矿物质为目的的营养素补充等保健食品制造', 1),
(184, 'C', '14', '149', '1493', '冷冻饮品及食用冰制造', '指以砂糖、乳制品、豆制品、蛋制品、油脂、果料和食用添加剂等经混合配制、加热杀菌、均质、老化、冻结（凝冻）而成的冷食饮品的制造，以及食用冰的制造', 1),
(185, 'C', '14', '149', '1494', '盐加工   ', '指以原盐为原料，经过化卤、蒸发、洗涤、粉碎、干燥、脱水、筛分等工序，或在其中添加碘酸钾及调味品等加工制成盐产品的生产活动', 1),
(186, 'C', '14', '149', '1495', '食品及饲料添加剂制造', '指增加或改善食品特色的化学品，以及补充动物饲料的营养成分和促进生长、防治疫病的制剂的生产活动', 1),
(187, 'C', '14', '149', '1499', '其他未列明食品制造', '', 1),
(188, 'C', '15', '15', '15', '酒、饮料和精制茶制造业', '', 1),
(189, 'C', '15', '151', '151', '酒的制造', '指酒精、白酒、啤酒及其专用麦芽、黄酒、葡萄酒、果酒、配制酒以及其他酒的生产', 1),
(190, 'C', '15', '151', '1511', '酒精制造', '指用玉米、小麦、薯类等淀粉质原料或用糖蜜等含糖质原料，经蒸煮、糖化、发酵及蒸馏等工艺制成的酒精产品的生产活动', 1),
(191, 'C', '15', '151', '1512', '白酒制造', '指以高粱等粮谷为主要原料，以大曲、小曲或麸曲及酒母等为糖化发酵剂，经蒸煮、糖化、发酵、蒸馏、陈酿、勾兑而制成的蒸馏酒产品的生产活动', 1),
(192, 'C', '15', '151', '1513', '啤酒制造', '指以麦芽（包括特种麦芽）、水为主要原料，加啤酒花，经酵母发酵酿制而成，含二氧化碳、起泡、低酒精度的发酵酒产品（包括无醇啤酒，也称脱醇啤酒）的生产活动，以及啤酒专用原料麦芽的生产活动', 1),
(193, 'C', '15', '151', '1514', '黄酒制造', '指以稻米、黍米、黑米、小麦、玉米等为主要原料，加曲、酵母等糖化发酵剂发酵酿制而成的发酵酒产品的生产活动', 1),
(194, 'C', '15', '151', '1515', '葡萄酒制造', '指以新鲜葡萄或葡萄汁为原料，经全部或部分发酵酿制而成，含有一定酒精度的发酵酒产品的生产活动', 1),
(195, 'C', '15', '151', '1519', '其他酒制造', '指除葡萄酒以外的果酒、配制酒以及上述未列明的其他酒产品的生产活动', 1),
(196, 'C', '15', '152', '152', '饮料制造', '', 1),
(197, 'C', '15', '152', '1521', '碳酸饮料制造', '指在一定条件下充入二氧化碳气的饮用品制造，其成品中二氧化碳气的含量（20℃时的体积倍数）不低于2.0倍', 1),
(198, 'C', '15', '152', '1522', '瓶（罐）装饮用水制造', '指以地下矿泉水和符合生活饮用水卫生标准的水为水源加工制成的，密封于塑料瓶（罐）、玻璃瓶或其他容器中，不含任何添加剂，可直接饮用的水的生产活动', 1),
(199, 'C', '15', '152', '1523', '果菜汁及果菜汁饮料制造', '指以新鲜或冷藏水果和蔬菜为原料，经加工制得的果菜汁液制品生产活动，以及在果汁或浓缩果汁、蔬菜汁中加入水、糖液、酸味剂等，经调制而成的可直接饮用的饮品（果汁含量不低于10％）的生产活动', 1),
(200, 'C', '15', '152', '1524', '含乳饮料和植物蛋白饮料制造', '指以鲜乳或乳制品为原料（经发酵或未经发酵），加入水、糖液等调制而成的可直接饮用的含乳饮品的生产活动，以及以蛋白质含量较高的植物的果实、种子或核果类、坚果类的果仁等为原料，在其加工制得的浆液中加入水、糖液等调制而成的可直接饮用的植物蛋白饮品的生产活动', 1),
(201, 'C', '15', '152', '1525', '固体饮料制造', '指以糖、食品添加剂、果汁或植物抽提物等为原料，加工制成粉末状、颗粒状或块状制品[其成品水分(质量分数)不高于5％]的生产活动', 1),
(202, 'C', '15', '152', '1529', '茶饮料及其他饮料制造', '指茶饮料、特殊用途饮料以及其他未列明的饮料制造', 1),
(203, 'C', '15', '153', '1530', '精制茶加工', '指对毛茶或半成品原料茶进行筛分、轧切、风选、干燥、匀堆、拼配等精制加工茶叶的生产活动', 1),
(204, 'C', '16', '16', '16', '烟草制品业 ', '', 1),
(205, 'C', '16', '161', '1610', '烟叶复烤', '指在原烟（初烤）基础上进行第二次烟叶水分调整的活动', 1),
(206, 'C', '16', '162', '1620', '卷烟制造', '指各种卷烟生产，但不包括生产烟用滤嘴棒的纤维丝束原料的制造', 1),
(207, 'C', '16', '169', '1690', '其他烟草制品制造', '', 1),
(208, 'C', '17', '17', '17', '纺织业', '', 1),
(209, 'C', '17', '171', '171', '棉纺织及印染精加工', '指棉、棉型化纤（化纤短丝）纺织及印染精加工', 1),
(210, 'C', '17', '171', '1711', '棉纺纱加工', '指以棉及棉型化学纤维为主要原料进行的纺纱加工', 1),
(211, 'C', '17', '171', '1712', '棉织造加工', '指以棉纱、混纺纱、化学纤维纱为主要原料进行的机织物织造加工', 1),
(212, 'C', '17', '171', '1713', '棉印染精加工', '指对非自产的棉和化学纤维织物进行漂白、染色、印花、轧光、起绒、缩水等工序的加工', 1),
(213, 'C', '17', '172', '172', '毛纺织及染整精加工', '', 1),
(214, 'C', '17', '172', '1721', '毛条和毛纱线加工', '指以毛及毛型化学纤维为原料进行梳条的加工，按毛纺工艺（精梳、粗梳、半精梳）进行纺纱的加工', 1),
(215, 'C', '17', '172', '1722', '毛织造加工', '指以毛及毛型化学纤维纱线为原料进行的机织物织造加工', 1),
(216, 'C', '17', '172', '1723', '毛染整精加工', '指对非自产的毛织物进行漂白、染色、印花等工序的染整精加工', 1),
(217, 'C', '17', '173', '173', '麻纺织及染整精加工', '', 1),
(218, 'C', '17', '173', '1731', '麻纤维纺前加工和纺纱', '指以苎麻、亚麻、大麻、黄麻、剑麻、罗布麻等为原料的纺前纤维加工和纺纱加工', 1),
(219, 'C', '17', '173', '1732', '麻织造加工', '指以苎麻、亚麻、大麻、黄麻、剑麻、罗布麻纤维纱线等为主要原料的机织物织造加工', 1),
(220, 'C', '17', '173', '1733', '麻染整精加工', '指对非自产的麻织物进行漂白、染色、印花等工序的染整精加工', 1),
(221, 'C', '17', '174', '174', '丝绢纺织及印染精加工', '', 1),
(222, 'C', '17', '174', '1741', '缫丝加工', '指由蚕茧经过加工缫制成丝的活动', 1),
(223, 'C', '17', '174', '1742', '绢纺和丝织加工', '指以丝为主要原料进行的丝织物织造加工                                                ', 1),
(224, 'C', '17', '174', '1743', '丝印染精加工', '指对非自产的丝织物进行漂白、染色、印花、轧光、起绒、缩水等工序的加工', 1),
(225, 'C', '17', '175', '175', '化纤织造及印染精加工', '指经纬双向或经向以化纤长丝(不包括化纤短纤）为主要原料生产的机织物', 1),
(226, 'C', '17', '175', '1751', '化纤织造加工', '指以化纤长丝(含有色长丝)为主要原料生产的机织坯布、色织布', 1),
(227, 'C', '17', '175', '1752', '化纤织物染整精加工', '指对化纤长丝坯布进行漂白、染色、印花、轧光、起绒、缩水等染整工序的加工', 1),
(228, 'C', '17', '176', '176', '针织或钩针编织物及其制品制造', '', 1),
(229, 'C', '17', '176', '1761', '针织或钩针编织物织造', '指采用经编、纬编、横编及钩针编工艺进行的针织物织造加工', 1),
(230, 'C', '17', '176', '1762', '针织或钩针编织物印染精加工', '指对非自产的针织品进行漂白、染色、印花、轧光、起绒、缩水等工序的加工', 1),
(231, 'C', '17', '176', '1763', '针织或钩针编织品制造', '指除针织或钩针编织服装以外的其他针织品或钩针编织品的加工', 1),
(232, 'C', '17', '177', '177', '家用纺织制成品制造', '', 1),
(233, 'C', '17', '177', '1771', '床上用品制造', '指以棉、麻、丝、毛、化学纤维等纤维及纺织品为主要原料，加工制造床上用品（包括含有填充物的被子、睡袋、枕头等类产品）的生产活动', 1),
(234, 'C', '17', '177', '1772', '毛巾类制品制造', '指以棉、麻、丝及化学纤维等为主要原料，加工制造毛巾类产品的生产活动', 1),
(235, 'C', '17', '177', '1773', '窗帘、布艺类产品制造', '指以棉、麻、丝、毛及化学纤维等为主要原料，加工制造窗帘、各种装饰罩（套）、靠垫、坐垫、贮物袋等生活用布艺产品的生产活动', 1),
(236, 'C', '17', '177', '1779', '其他家用纺织制成品制造', '指以棉、麻、丝、毛及化学纤维等为主要原料，加工制造毛毯、桌布、台布、餐巾、擦布、洗碗巾等餐厨生活制品的其他家用纺织制成品生产活动', 1),
(237, 'C', '17', '178', '178', '非家用纺织制成品制造', '也称产业用纺织制成品制造', 1),
(238, 'C', '17', '178', '1781', '非织造布制造', '指定向或随机排列的纤维，通过摩擦、抱合或粘合，或者这些方法的组合而相互结合制成的片状物、纤网或絮垫的生产活动；所用纤维可以是天然纤维、化学纤维和无机纤维，也可以是短纤维、长丝或直接形成的纤维状物', 1),
(239, 'C', '17', '178', '1782', '绳、索、缆制造', '指用天然纤维和化学纤维制造绳、索具、缆绳、合股线的生产活动', 1),
(240, 'C', '17', '178', '1783', '纺织带和帘子布制造', '指帘子布、复合材料用基布、输送带基布、传送带和胶管等增强材料的生产活动', 1),
(241, 'C', '17', '178', '1784', '篷、帆布制造', '指车用篷布、帐篷布、鞋用纺织材料、灯箱布等纺织材料的生产活动', 1),
(242, 'C', '17', '178', '1789', '其他非家用纺织制成品制造', '指革基布，过滤、防护用纺织品，工业用毡、呢，建筑用纺织品，交通运输用纺织品，包装用纺织品，文体用纺织品，绝缘隔热纺织品，农业用纺织品，渔业用纺织品，造纸用纺织品等其他产业用纺织制成品的生产活动', 1),
(243, 'C', '18', '18', '18', '纺织服装、服饰业', '', 1),
(244, 'C', '18', '181', '1810', '机织服装制造', '指以机织面料为主要原料，缝制各种男、女服装，以及儿童成衣的活动；包括非自产原料制作的服装，以及固定生产地点的服装制作活动', 1),
(245, 'C', '18', '182', '1820', '针织或钩针编织服装制造', '指以针织、钩针编织面料为主要原料，经裁剪后缝制各种男、女服装，以及儿童成衣的活动', 1),
(246, 'C', '18', '183', '1830', '服饰制造', '指帽子、手套、围巾、领带、领结、手绢，以及袜子等服装饰品的加工', 1),
(247, 'C', '19', '19', '19', '皮革、毛皮、羽毛及其制品和制鞋业', '', 1),
(248, 'C', '19', '191', '1910', '皮革鞣制加工', '指动物生皮经脱毛、鞣制等物理和化学方法加工，再经涂饰和整理，制成具有不易腐烂、柔韧、透气等性能的皮革生产活动', 1),
(249, 'C', '19', '192', '192', '皮革制品制造', '', 1),
(250, 'C', '19', '192', '1921', '皮革服装制造', '指全部或大部分用皮革、人造革、合成革为面料，制作各式服装的活动', 1),
(251, 'C', '19', '192', '1922', '皮箱、包（袋）制造', '指全部或大部分用皮革、人造革、合成革为材料，或者以塑料、纺织物为材料，制作各种用途的皮箱、皮包(袋)，或其他材料的箱、包(袋)等的制作活动', 1),
(252, 'C', '19', '192', '1923', '皮手套及皮装饰制品制造 ', '指全部或大部分用皮革、人造革、合成革为材料制成的皮手套、皮带，以及皮领带等皮装饰制品的生产活动', 1),
(253, 'C', '19', '192', '1929', '其他皮革制品制造', '指全部或大部分用皮革、人造革、合成革为材料制成上述未列明的其他各种皮革制品的生产活动', 1),
(254, 'C', '19', '193', '193', '毛皮鞣制及制品加工', '', 1),
(255, 'C', '19', '193', '1931', '毛皮鞣制加工', '指带毛动物生皮经鞣制等化学和物理方法处理后，保持其绒毛形态及特点的毛皮(又称裘皮)的生产活动', 1),
(256, 'C', '19', '193', '1932', '毛皮服装加工', '指用各种动物毛皮和人造毛皮为面料或里料，加工制作毛皮服装的生产活动', 1),
(257, 'C', '19', '193', '1939', '其他毛皮制品加工', '指用各种动物毛皮和人造毛皮为材料，加工制作上述类别未列明的其他各种用途毛皮制品的生产活动', 1),
(258, 'C', '19', '194', '194', '羽毛(绒)加工及制品制造', '', 1),
(259, 'C', '19', '194', '1941', '羽毛（绒）加工', '指对鹅、鸭等禽类羽毛进行加工成标准毛的生产活动', 1),
(260, 'C', '19', '194', '1942', '羽毛（绒）制品加工', '指用加工过的羽毛(绒)作为填充物制作各种用途的羽绒制品(如羽绒服装、羽绒寝具、羽绒睡袋等)的生产活动', 1),
(261, 'C', '19', '195', '195', '制鞋业', '指纺织面料鞋、皮鞋、塑料鞋、橡胶鞋及其他各种鞋的生产活动', 1),
(262, 'C', '19', '195', '1951', '纺织面料鞋制造', '指用各种纺织面料、木材、棕草等原料缝制、模压或编制各种鞋的生产活动', 1),
(263, 'C', '19', '195', '1952', '皮鞋制造', '指全部或大部分用皮革、人造革、合成革为面料，以橡胶、塑料或合成材料等为外底，按缝绱、胶粘、模压、注塑等工艺方法制作各种皮鞋的生产活动', 1),
(264, 'C', '19', '195', '1953', '塑料鞋制造', '指以聚氯乙烯、聚乙烯、聚氨酯和乙烯醋酸乙烯等树脂为原料生产发泡或不发泡的塑料鞋类制品的活动', 1),
(265, 'C', '19', '195', '1954', '橡胶鞋制造', '指以橡胶作为鞋底、鞋帮的橡胶鞋及其橡胶鞋部件的生产活动', 1),
(266, 'C', '19', '195', '1959', '其他制鞋业', '', 1),
(267, 'C', '20', '20', '20', '木材加工和木、竹、藤、棕、草制品业', '', 1),
(268, 'C', '20', '201', '201', '木材加工', '', 1),
(269, 'C', '20', '201', '2011', '锯材加工', '指以原木为原料，利用锯木机械或手工工具将原木纵向锯成具有一定断面尺寸（宽、厚度）的木材加工生产活动，用防腐剂和其他物质浸渍木料或对木料进行化学处理的加工，以及地板毛料的制造', 1),
(270, 'C', '20', '201', '2012', '木片加工', '指利用森林采伐、造材、加工等剩余物和定向培育的木材，经削（刨）片机加工成一定规格的产品生产活动', 1),
(271, 'C', '20', '201', '2013', '单板加工', '  指用于单板层积材（LVL）、纺织用木质层压板、电工层压木板和木质层积塑料等单位的生产；随着科技进步，装饰单板（厚度0.55mm以下的单板)发展很快,主要用于装饰贴面二次加工，如生产装饰贴面胶合板、实木复合地板、木质复合门窗、家具、楼梯、汽车内饰、木墙纸和踢脚线等', 1),
(272, 'C', '20', '201', '2019', '其他木材加工', '指对木材进行干燥、防腐、改性、染色加工等活动', 1),
(273, 'C', '20', '202', '202', '人造板制造', '指用木材及其剩余物、棉秆、甘蔗渣和芦苇等植物纤维为原料，加工成符合国家标准的胶合板、纤维板、刨花板、细木工板和木丝板等产品的生产活动，以及人造板二次加工装饰板的制造', 1),
(274, 'C', '20', '202', '2021', '胶合板制造', '指具有一定规格的原木经旋（刨）切成单板，再经干燥、涂胶、组坯、热压而成的符合国家标准及供需双方协定标准的产品生产活动', 1),
(275, 'C', '20', '202', '2022', '纤维板制造', '指用木材碎料（包括木片）、棉秆、甘蔗渣、芦苇等植物纤维作原料，经削片纤维分离，铺装成型，热压而成的产品生产活动', 1),
(276, 'C', '20', '202', '2023', '刨花板制造', '指用木材碎料（包括木片）和其他植物纤维作原料，制成刨花，经干燥、施胶，铺装成型，热压而成的产品生产活动', 1),
(277, 'C', '20', '202', '2029', '其他人造板制造', '包括非木质纤维、胶合木等其他各类人造板的制造', 1),
(278, 'C', '20', '203', '203', '木制品制造', '指以木材为原料加工成建筑用木料和木材组件、木容器、软木制品及其他木制品的生产活动，但不包括木质家具的制造', 1),
(279, 'C', '20', '203', '2031', '建筑用木料及木材组件加工', '指主要用于建筑施工工程的木质制品，如建筑施工用的大木工或其他支撑物，以及建筑木工的生产活动', 1),
(280, 'C', '20', '203', '2032', '木门窗、楼梯制造', '', 1),
(281, 'C', '20', '203', '2033', '地板制造', '', 1),
(282, 'C', '20', '203', '2034', '木制容器制造', '', 1),
(283, 'C', '20', '203', '2039', '软木制品及其他木制品制造', '指天然软木除去表皮，经初加工后获得的结块软木及其制品的生产活动，以及其他未列明的木质产品的生产活动', 1),
(284, 'C', '20', '204', '204', '竹、藤、棕、草等制品制造', '指除木材以外，以竹、藤、棕、草等天然植物为原料生产制品的活动，但不包括家具的制造', 1),
(285, 'C', '20', '204', '2041', '竹制品制造', '指竹胶合板、竹地板、竹丝板等竹制品的制造', 1),
(286, 'C', '20', '204', '2042', '藤制品制造', '', 1),
(287, 'C', '20', '204', '2043', '棕制品制造', '', 1),
(288, 'C', '20', '204', '2049', '草及其他制品制造', '', 1),
(289, 'C', '21', '21', '21', '家具制造业 ', '指用木材、金属、塑料、竹、藤等材料制作的，具有坐卧、凭倚、储藏、间隔等功能，可用于住宅、旅馆、办公室、学校、餐馆、医院、剧场、公园、船舰、飞机、机动车等任何场所的各种家具的制造', 1),
(290, 'C', '21', '211', '2110', '木质家具制造', '指以天然木材和木质人造板为主要材料，配以其他辅料（如油漆、贴面材料、玻璃、五金配件等）制作各种家具的生产活动', 1),
(291, 'C', '21', '212', '2120', '竹、藤家具制造', '指以竹材和藤材为主要材料，配以其他辅料制作各种家具的生产活动', 1),
(292, 'C', '21', '213', '2130', '金属家具制造', '指支(框)架及主要部件以铸铁、钢材、钢板、钢管、合金等金属为主要材料，结合使用木、竹、塑等材料，配以人造革、尼龙布、泡沫塑料等其他辅料制作各种家具的生产活动', 1),
(293, 'C', '21', '214', '2140', '塑料家具制造', '指用塑料管、板、异型材加工或用塑料、玻璃钢（即增强塑料）直接在模具中成型的家具的生产活动', 1),
(294, 'C', '21', '219', '2190', '其他家具制造', '指主要由弹性材料(如弹簧、蛇簧、拉簧等)和软质材料(如棕丝、棉花、乳胶海绵、泡沫塑料等)，辅以绷结材料(如绷绳、绷带、麻布等)和装饰面料及饰物(如棉、毛、化纤织物及牛皮、羊皮、人造革等)制成的各种软家具；以玻璃为主要材料，辅以木材或金属材料制成的各种玻璃家具，以及其他未列明的原材料制作各种家具的生产活动', 1),
(295, 'C', '22', '22', '22', '造纸和纸制品业 ', '', 1),
(296, 'C', '22', '221', '221', '纸浆制造', '指经机械或化学方法加工纸浆的生产活动', 1),
(297, 'C', '22', '221', '2211', '木竹浆制造', '', 1),
(298, 'C', '22', '221', '2212', '非木竹浆制造', '', 1),
(299, 'C', '22', '222', '222', '造纸', '指用纸浆或其他原料（如矿渣棉、云母、石棉等）悬浮在流体中的纤维，经过造纸机或其他设备成型，或手工操作而成的纸及纸板的制造', 1),
(300, 'C', '22', '222', '2221', '机制纸及纸板制造', '', 1),
(301, 'C', '22', '222', '2222', '手工纸制造', '指采用手工操作成型，制成纸的生产活动', 1),
(302, 'C', '22', '222', '2223', '加工纸制造', '指对原纸及纸板进一步加工的生产活动', 1),
(303, 'C', '22', '223', '223', '纸制品制造', '指用纸及纸板为原料，进一步加工制成纸制品的生产活动', 1),
(304, 'C', '22', '223', '2231', '纸和纸板容器制造', '', 1),
(305, 'C', '22', '223', '2239', '其他纸制品制造', '指符合出售规格或包装要求的纸制品，以及其他未列明的纸制品的制造', 1),
(306, 'C', '23', '23', '23', '印刷和记录媒介复制业', '', 1),
(307, 'C', '23', '231', '231', '印刷', '', 1),
(308, 'C', '23', '231', '2311', '书、报刊印刷', '', 1),
(309, 'C', '23', '231', '2312', '本册印制', '指由各种纸及纸板制作的，用于书写和其他用途的本册生产活动', 1),
(310, 'C', '23', '231', '2319', '包装装潢及其他印刷', '指根据一定的商品属性、形态，采用一定的包装材料，经过对商品包装的造型结构艺术和图案文字的设计与安排来装饰美化商品的印刷，以及其他印刷活动', 1),
(311, 'C', '23', '232', '2320', '装订及印刷相关服务', '指专门企业从事的装订、压印媒介制造等与印刷有关的服务', 1),
(312, 'C', '23', '233', '2330', '记录媒介复制', '指将母带、母盘上的信息进行批量翻录的生产活动', 1),
(313, 'C', '24', '24', '24', '文教、工美、体育和娱乐用品制造业', '', 1),
(314, 'C', '24', '241', '241', '文教办公用品制造', '', 1),
(315, 'C', '24', '241', '2411', '文具制造', '指办公、学习等使用的各种文具的制造', 1),
(316, 'C', '24', '241', '2412', '笔的制造', '指用于学习、办公或绘画等用途的各种笔制品的制造', 1),
(317, 'C', '24', '241', '2413', '教学用模型及教具制造', '指主要用于教学的各种专用模型、标本及教具的制造', 1),
(318, 'C', '24', '241', '2414', '墨水、墨汁制造', '', 1),
(319, 'C', '24', '241', '2419', '其他文教办公用品制造', '指上述未列明的文教办公类用品的制造', 1),
(320, 'C', '24', '242', '242', '乐器制造', '指中国民族乐器、西乐器等各种乐器及乐器零部件和配套产品的制造，但不包括玩具乐器的制造', 1),
(321, 'C', '24', '242', '2421', '中乐器制造', '', 1),
(322, 'C', '24', '242', '2422', '西乐器制造', '', 1),
(323, 'C', '24', '242', '2423', '电子乐器制造', '', 1),
(324, 'C', '24', '242', '2429', '其他乐器及零件制造', '指其他未列明的乐器、乐器零件及配套产品的制造', 1),
(325, 'C', '24', '243', '243', '工艺美术品制造', '', 1),
(326, 'C', '24', '243', '2431', '雕塑工艺品制造', '指以玉石、宝石、象牙、角、骨、贝壳等硬质材料，木、竹、椰壳、树根、软木等天然植物，以及石膏、泥、面、塑料等为原料，经雕刻、琢、磨、捏或塑等艺术加工而制成的各种供欣赏和实用的工艺品的制作活动', 1),
(327, 'C', '24', '243', '2432', '金属工艺品制造', '指以金、银、铜、铁、锡等各种金属为原料，经过制胎、浇铸、锻打、錾刻、搓丝、焊接、纺织、镶嵌、点兰、烧制、打磨、电镀等各种工艺加工制成的造型美观、花纹图案精致的工艺美术品的制作活动', 1),
(328, 'C', '24', '243', '2433', '漆器工艺品制造', '指将半生漆、腰果漆加工调配成各种鲜艳的漆料，以木、纸、塑料、铜、布等作胎，采用推光、雕填、彩画、镶嵌、刻灰等传统工艺和现代漆器工艺进行的工艺制品的制作活动', 1),
(329, 'C', '24', '243', '2434', '花画工艺品制造', '指以绢、丝、绒、纸、涤纶、塑料、羽毛、通草以及鲜花草等为原料，经造型设计、模压、剪贴、干燥等工艺精制而成的花、果、叶等人造花类工艺品，以画面出现、可以挂或摆的具有欣赏性、装饰性的画类工艺品的制作活动', 1),
(330, 'C', '24', '243', '2435', '天然植物纤维编织工艺品制造', '指以竹、藤、棕、草、柳、葵、麻等天然植物纤维为材料，经编织或镶嵌而成具有造型艺术或图案花纹，以欣赏为主的工艺陈列品以及工艺实用品的制作活动', 1),
(331, 'C', '24', '243', '2436', '抽纱刺绣工艺品制造', '指以棉、麻、丝、毛及人造纤维纺织品等为主要原料，经设计、刺绣、抽、拉、钩等工艺加工各种生活装饰用品，以及以纺织品为主要原料，经特殊手工工艺或民间工艺方法加工成各种具有较强装饰效果的生活用纺织品的制作活动', 1),
(332, 'C', '24', '243', '2437', '地毯、挂毯制造', '指以羊毛、丝、棉、麻及人造纤维等为原料，经手工编织、机织、栽绒等方式加工而成的各种具有装饰性的地面覆盖物或可用于悬挂、垫坐等用途的生活装饰用品的制作活动', 1),
(333, 'C', '24', '243', '2438', '珠宝首饰及有关物品制造', '指以金、银、铂等贵金属及其合金以及钻石、宝石、玉石、翡翠、珍珠等为原料，经金属加工和连结组合、镶嵌等工艺加工制作各种图案的装饰品的制作活动', 1),
(334, 'C', '24', '243', '2439', '其他工艺美术品制造', '', 1),
(335, 'C', '24', '244', '244', '体育用品制造', '', 1),
(336, 'C', '24', '244', '2441', '球类制造', '指各种皮制、胶制、革制的可充气的运动用球，以及其他材料制成的各种运动用硬球、软球等球类产品的生产活动', 1),
(337, 'C', '24', '244', '2442', '体育器材及配件制造', '指各项竞技比赛和训练用器材及用品，体育场馆设施及器件的生产活动', 1),
(338, 'C', '24', '244', '2443', '训练健身器材制造', '指供健身房、家庭或体育训练用的健身器材及运动物品的制造', 1),
(339, 'C', '24', '244', '2444', '运动防护用具制造', '指用各种材质，为各项运动特制手套、鞋、帽和护具的生产活动', 1),
(340, 'C', '24', '244', '2449', '其他体育用品制造', '指钓鱼专用的各种用具及用品，以及上述未列明的体育用品制造', 1),
(341, 'C', '24', '245', '2450', '玩具制造', '指以儿童为主要使用者，用于玩耍、智力开发等娱乐器具的制造 ', 1),
(342, 'C', '24', '246', '246', '游艺器材及娱乐用品制造', '', 1),
(343, 'C', '24', '246', '2461', '露天游乐场所游乐设备制造', '指主要安装在公园、游乐园、水上乐园、儿童乐园等露天游乐场所的电动及非电动游乐设备和游艺器材的制造', 1),
(344, 'C', '24', '246', '2462', '游艺用品及室内游艺器材制造', '指主要供室内、桌上等游艺及娱乐场所使用的游乐设备、游艺器材和游艺娱乐用品，以及主要安装在室内游乐场所的电子游乐设备的制造', 1),
(345, 'C', '24', '246', '2469', '其他娱乐用品制造', '', 1),
(346, 'C', '25', '25', '25', '石油加工、炼焦和核燃料加工业 ', '', 1),
(347, 'C', '25', '251', '251', '精炼石油产品制造', '', 1),
(348, 'C', '25', '251', '2511', '原油加工及石油制品制造', '指从天然原油、人造原油中提炼液态或气态燃料以及石油制品的生产活动', 1),
(349, 'C', '25', '251', '2512', '人造原油制造', '指从油母页岩中提炼原油的生产活动', 1),
(350, 'C', '25', '252', '2520', '炼焦', '指主要从硬煤和褐煤中生产焦炭、干馏炭及煤焦油或沥青等副产品的炼焦炉的操作活动', 1);
INSERT INTO `setup_industry` (`id`, `kind`, `big_code`, `mid_code`, `small_code`, `msg`, `remark`, `online`) VALUES
(351, 'C', '25', '253', '2530', '核燃料加工', '指从沥青铀矿或其他含铀矿石中提取铀、浓缩铀的生产，对铀金属的冶炼、加工，以及其他放射性元素、同位素标记、核反应堆燃料元件的制造，还包括与核燃料加工有关的核废物处置活动', 1),
(352, 'C', '26', '26', '26', '化学原料和化学制品制造业', '', 1),
(353, 'C', '26', '261', '261', '基础化学原料制造', '', 1),
(354, 'C', '26', '261', '2611', '无机酸制造', '', 1),
(355, 'C', '26', '261', '2612', '无机碱制造', '指烧碱、纯碱等的生产活动', 1),
(356, 'C', '26', '261', '2613', '无机盐制造', '', 1),
(357, 'C', '26', '261', '2614', '有机化学原料制造', '', 1),
(358, 'C', '26', '261', '2619', '其他基础化学原料制造', '', 1),
(359, 'C', '26', '262', '262', '肥料制造', '指化学肥料、有机肥料及微生物肥料的制造', 1),
(360, 'C', '26', '262', '2621', '氮肥制造', '指矿物氮肥及用化学方法制成含有作物营养元素氮的化肥的生产活动', 1),
(361, 'C', '26', '262', '2622', '磷肥制造', '指以磷矿石为主要原料，用化学或物理方法制成含有作物营养元素磷的化肥的生产活动', 1),
(362, 'C', '26', '262', '2623', '钾肥制造', '指用天然钾盐矿经富集精制加工制成含有作物营养元素钾的化肥的生产活动', 1),
(363, 'C', '26', '262', '2624', '复混肥料制造', '指经过化学或物理方法加工制成的，含有两种以上作物所需主要营养元素（氮、磷、钾）的化肥的生产活动；包括通用型复混肥料和专用型复混肥料', 1),
(364, 'C', '26', '262', '2625', '有机肥料及微生物肥料制造', '指来源于动植物，经发酵或腐熟等化学处理后，适用于土壤并提供植物养分供给的，其主要成分为含氮物质的肥料制造', 1),
(365, 'C', '26', '262', '2629', '其他肥料制造', '指上述未列明的微量元素肥料及其他肥料的生产', 1),
(366, 'C', '26', '263', '263', '农药制造', '指用于防治农业、林业作物的病、虫、草、鼠和其他有害生物，调节植物生长的各种化学农药、微生物农药、生物化学农药，以及仓储、农林产品的防蚀、河流堤坝、铁路、机场、建筑物及其他场所用药的原药和制剂的生产活动', 1),
(367, 'C', '26', '263', '2631', '化学农药制造', '指化学农药原药，以及经过机械粉碎、混合或稀释制成粉状、乳状和水状的化学农药制剂的生产活动', 1),
(368, 'C', '26', '263', '2632', '生物化学农药及微生物农药制造', '指由细菌、真菌、病毒和原生动物或基因修饰的微生物等自然产生，以及由植物提取的防治病、虫、草、鼠和其他有害生物的农药制剂生产活动', 1),
(369, 'C', '26', '264', '264', '涂料、油墨、颜料及类似产品制造', '', 1),
(370, 'C', '26', '264', '2641', '涂料制造', '指在天然树脂或合成树脂中加入颜料、溶剂和辅助材料，经加工后制成的覆盖材料的生产活动', 1),
(371, 'C', '26', '264', '2642', '油墨及类似产品制造', '指由颜料、联接料（植物油、矿物油、树脂、溶剂）和填充料经过混合、研磨调制而成，用于印刷的有色胶浆状物质，以及用于计算机打印、复印机用墨等的生产活动', 1),
(372, 'C', '26', '264', '2643', '颜料制造', '指用于陶瓷、搪瓷、玻璃等工业的无机颜料及类似材料的生产活动，以及油画、水粉画、广告等艺术用颜料的制造', 1),
(373, 'C', '26', '264', '2644', '染料制造', '指有机合成、植物性或动物性色料，以及有机颜料的生产活动', 1),
(374, 'C', '26', '264', '2645', '密封用填料及类似品制造', '指用于建筑涂料、密封和漆工用的填充料，以及其他类似化学材料的制造', 1),
(375, 'C', '26', '265', '265', '合成材料制造', '', 1),
(376, 'C', '26', '265', '2651', '初级形态塑料及合成树脂制造', '也称初级塑料或原状塑料的生产活动，包括通用塑料、工程塑料、功能高分子塑料的制造', 1),
(377, 'C', '26', '265', '2652', '合成橡胶制造', '指人造橡胶或合成橡胶及高分子弹性体的生产活动', 1),
(378, 'C', '26', '265', '2653', '合成纤维单（聚合）体制造', '指以石油、天然气、煤等为主要原料，用有机合成的方法制成合成纤维单体或聚合体的生产活动', 1),
(379, 'C', '26', '265', '2659', '其他合成材料制造', '指陶瓷纤维等特种纤维及其增强的复合材料的生产活动；其他专用合成材料的制造 ', 1),
(380, 'C', '26', '266', '266', '专用化学产品制造', '', 1),
(381, 'C', '26', '266', '2661', '化学试剂和助剂制造', '指各种化学试剂、催化剂及专用助剂的生产活动', 1),
(382, 'C', '26', '266', '2662', '专项化学用品制造', '指水处理化学品、造纸化学品、皮革化学品、油脂化学品、油田化学品、生物工程化学品、日化产品专用化学品等产品的生产活动', 1),
(383, 'C', '26', '266', '2663', '林产化学产品制造', '指以林产品为原料，经过化学和物理加工方法生产产品的活动', 1),
(384, 'C', '26', '266', '2664', '信息化学品制造', '指电影、照相、医用、幻灯及投影用感光材料、冲洗套药，磁、光记录材料，光纤维通讯用辅助材料，及其专用化学制剂的制造', 1),
(385, 'C', '26', '266', '2665', '环境污染处理专用药剂材料制造', '指对水污染、空气污染、固体废物等污染物处理所专用的化学药剂及材料的制造', 1),
(386, 'C', '26', '266', '2666', '动物胶制造', '指以动物骨、皮为原料，经一系列工艺处理制成有一定透明度、粘度、纯度的胶产品的生产活动', 1),
(387, 'C', '26', '266', '2669', '其他专用化学产品制造    ', '指其他各种用途的专用化学用品的制造', 1),
(388, 'C', '26', '267', '267', '炸药、火工及焰火产品制造', '', 1),
(389, 'C', '26', '267', '2671', '炸药及火工产品制造', '指各种军用和生产用炸药、雷管及类似的火工产品的制造', 1),
(390, 'C', '26', '267', '2672', '焰火、鞭炮产品制造 ', '指节日、庆典用焰火及民用烟花、鞭炮等产品的制造', 1),
(391, 'C', '26', '268', '268', '日用化学产品制造', '', 1),
(392, 'C', '26', '268', '2681', '肥皂及合成洗涤剂制造', '指以喷洒、涂抹、浸泡等方式施用于肌肤、器皿、织物、硬表面，即冲即洗，起到清洁、去污、渗透、乳化、分散、护理、消毒除菌等功能，广泛用于家居、个人清洁卫生、织物清洁护理、工业清洗、公共设施及环境卫生清洗等领域的产品（固、液、粉、膏、片状等），以及中间体表面活性剂产品的制造', 1),
(393, 'C', '26', '268', '2682', '化妆品制造', '指以涂抹、喷洒或者其他类似方法，撒布于人体表面任何部位（皮肤、毛发、指甲、口唇等），以达到清洁、消除不良气味、护肤、美容和修饰目的的日用化学工业产品的制造', 1),
(394, 'C', '26', '268', '2683', '口腔清洁用品制造', '指用于口腔或牙齿清洁卫生制品的生产活动', 1),
(395, 'C', '26', '268', '2684', '香料、香精制造', '指具有香气和香味，用于调配香精的物质——香料的生产，以及以多种天然香料和合成香料为主要原料，并与其他辅料一起按合理的配方和工艺调配制得的具有一定香型的复杂混合物，主要用于各类加香产品中的香精的生产活动', 1),
(396, 'C', '26', '268', '2689', '其他日用化学产品制造', '指室内散香或除臭制品，光洁用品，擦洗膏及类似制品，动物用化妆盥洗品，火柴，蜡烛及类似制品等日用化学产品的生产活动', 1),
(397, 'C', '27', '27', '27', '医药制造业 ', '', 1),
(398, 'C', '27', '271', '2710', '化学药品原料药制造', '指供进一步加工化学药品制剂所需的原料药生产活动', 1),
(399, 'C', '27', '272', '2720', '化学药品制剂制造', '指直接用于人体疾病防治、诊断的化学药品制剂的制造', 1),
(400, 'C', '27', '273', '2730', '中药饮片加工', '指对采集的天然或人工种植、养殖的动物和植物的药材部位进行加工、炮制，使其符合中药处方调剂或中成药生产使用的活动', 1),
(401, 'C', '27', '274', '2740', '中成药生产', '指直接用于人体疾病防治的传统药的加工生产活动', 1),
(402, 'C', '27', '275', '2750', '兽用药品制造', '指用于动物疾病防治医药的制造', 1),
(403, 'C', '27', '276', '2760', '生物药品制造', '指利用生物技术生产生物化学药品、基因工程药物的生产活动', 1),
(404, 'C', '27', '277', '2770', '卫生材料及医药用品制造', '指卫生材料、外科敷料、药品包装材料、辅料以及其他内、外科用医药制品的制造', 1),
(405, 'C', '28', '28', '28', '化学纤维制造业', '', 1),
(406, 'C', '28', '281', '281', '纤维素纤维原料及纤维制造', '', 1),
(407, 'C', '28', '281', '2811', '化纤浆粕制造', '指纺织生产用粘胶纤维的基本原料生产活动', 1),
(408, 'C', '28', '281', '2812', '人造纤维（纤维素纤维）制造', '指用化纤浆粕经化学加工生产纤维的活动', 1),
(409, 'C', '28', '282', '282', '合成纤维制造', '指以石油、天然气、煤等为主要原料，用有机合成的方法制成单体，聚合后经纺丝加工生产纤维的活动', 1),
(410, 'C', '28', '282', '2821', '锦纶纤维制造', '也称聚酰胺纤维制造，指由尼龙66盐和聚己内酰胺为主要原料生产合成纤维的活动', 1),
(411, 'C', '28', '282', '2822', '涤纶纤维制造', '也称聚酯纤维制造，指以聚对苯二甲酸乙二醇酯（简称聚酯）为原料生产合成纤维的活动', 1),
(412, 'C', '28', '282', '2823', '腈纶纤维制造', '也称聚丙烯腈纤维，指以丙烯腈为主要原料（含丙烯腈85%以上）生产合成纤维的活动', 1),
(413, 'C', '28', '282', '2824', '维纶纤维制造', '也称聚乙烯醇纤维制造，指以聚乙烯醇为主要原料生产合成纤维的活动', 1),
(414, 'C', '28', '282', '2825', '丙纶纤维制造', '也称聚丙烯纤维制造，指以聚丙烯为主要原料生产合成纤维的活动 ', 1),
(415, 'C', '28', '282', '2826', '氨纶纤维制造', '也称聚氨酯纤维制造，指以聚氨基甲酸酯为主要原料生产合成纤维的活动 ', 1),
(416, 'C', '28', '282', '2829', '其他合成纤维制造', '', 1),
(417, 'C', '29', '29', '29', '橡胶和塑料制品业', '', 1),
(418, 'C', '29', '291', '291', '橡胶制品业', '指以天然及合成橡胶为原料生产各种橡胶制品的活动，还包括利用废橡胶再生产橡胶制品的活动；不包括橡胶鞋制造', 1),
(419, 'C', '29', '291', '2911', '轮胎制造', '', 1),
(420, 'C', '29', '291', '2912', '橡胶板、管、带制造', '指用未硫化的、硫化的或硬质橡胶生产橡胶板状、片状、管状、带状、棒状和异型橡胶制品的活动，以及以橡胶为主要成分，用橡胶灌注、涂层、覆盖或层叠的纺织物、纱绳、钢丝（钢缆）等制作的传动带或输送带的生产活动', 1),
(421, 'C', '29', '291', '2913', '橡胶零件制造', '指各种用途的橡胶异形制品、橡胶零配件制品的生产活动', 1),
(422, 'C', '29', '291', '2914', '再生橡胶制造', '指用废橡胶生产再生橡胶的活动', 1),
(423, 'C', '29', '291', '2915', '日用及医用橡胶制品制造', '', 1),
(424, 'C', '29', '291', '2919', '其他橡胶制品制造', '', 1),
(425, 'C', '29', '292', '292', '塑料制品业', '指以合成树脂（高分子化合物）为主要原料，经采用挤塑、注塑、吹塑、压延、层压等工艺加工成型的各种制品的生产，以及利用回收的废旧塑料加工再生产塑料制品的活动；不包括塑料鞋制造', 1),
(426, 'C', '29', '292', '2921', '塑料薄膜制造', '指用于农业覆盖，工业、商业及日用包装薄膜的制造', 1),
(427, 'C', '29', '292', '2922', '塑料板、管、型材制造', '指各种塑料板、管及管件、棒材、薄片等的生产活动，以及以聚氯乙烯为主要原料，经连续挤出成型的塑料异型材的生产活动', 1),
(428, 'C', '29', '292', '2923', '塑料丝、绳及编织品制造', '指塑料制丝、绳、扁条，塑料袋及编织袋、编织布等的生产活动', 1),
(429, 'C', '29', '292', '2924', '泡沫塑料制造', '指以合成树脂为主要原料，经发泡成型工艺加工制成内部具有微孔的塑料制品的生产活动', 1),
(430, 'C', '29', '292', '2925', '塑料人造革、合成革制造', '指外观和手感似皮革，其透气、透湿性虽然略逊色于天然革，但具有优异的物理、机械性能，如强度和耐磨性等，并可代替天然革使用的塑料人造革的生产活动；模拟天然人造革的组成和结构，正反面都与皮革十分相似，比普通人造革更近似天然革，并可代替天然革的塑料合成革的生产活动', 1),
(431, 'C', '29', '292', '2926', '塑料包装箱及容器制造', '指用吹塑或注塑工艺等制成的，可盛装各种物品或液体物质，以便于储存、运输等用途的塑料包装箱及塑料容器制品的生产活动', 1),
(432, 'C', '29', '292', '2927', '日用塑料制品制造', '指塑料制餐、厨用具，卫生设备、洁具及其配件，塑料服装，日用塑料装饰品，以及其他日用塑料制品的生产活动', 1),
(433, 'C', '29', '292', '2928', '塑料零件制造', '指塑料制绝缘零件、密封制品、紧固件，以及汽车、家具等专用零配件的生产活动', 1),
(434, 'C', '29', '292', '2929', '其他塑料制品制造', '指上述未列明的其他各类非日用塑料制品的生产活动', 1),
(435, 'C', '30', '30', '30', '非金属矿物制品业', '', 1),
(436, 'C', '30', '301', '301', '水泥、石灰和石膏制造', '', 1),
(437, 'C', '30', '301', '3011', '水泥制造', '指以水泥熟料加入适量石膏或一定混合材，经研磨设备（水泥磨）磨制到规定的细度，制成水凝水泥的生产活动，还包括水泥熟料的生产活动', 1),
(438, 'C', '30', '301', '3012', '石灰和石膏制造', '', 1),
(439, 'C', '30', '302', '302', '石膏、水泥制品及类似制品制造', '', 1),
(440, 'C', '30', '302', '3021', '水泥制品制造', '指水泥制管、杆、桩、砖、瓦等制品制造', 1),
