(651, 'C', '35', '358', '3586', '假肢、人工器官及植（介）入器械制造', '指外科、牙科等医疗专用及兽医用假肢、人工器官、植入器械的制造，还包括矫形器具的制造', 1),
(652, 'C', '35', '358', '3589', '其他医疗设备及器械制造', '指外科、牙科等医疗专用及兽医用家具器械的制造，以及其他未列明的医疗设备及器械的制造', 1),
(653, 'C', '35', '359', '359', '环保、社会公共服务及其他专用设备制造', '', 1),
(654, 'C', '35', '359', '3591', '环境保护专用设备制造', '指环境污染防治、废旧物品加工，以及工业材料回收专用设备的制造', 1),
(655, 'C', '35', '359', '3592', '地质勘查专用设备制造', '指地质勘查（勘探）专用设备的制造；不包括通用钻采、挖掘机械的制造', 1),
(656, 'C', '35', '359', '3593', '邮政专用机械及器材制造', '', 1),
(657, 'C', '35', '359', '3594', '商业、饮食、服务专用设备制造', '', 1),
(658, 'C', '35', '359', '3595', '社会公共安全设备及器材制造', '指公安、消防、安全等社会公共安全设备及器材的制造和加工', 1),
(659, 'C', '35', '359', '3596', '交通安全、管制及类似专用设备制造', '指除铁路运输以外的道路运输、水上运输及航空运输等有关的管理、安全、控制专用设备的制造；不包括电气照明设备、信号设备的制造', 1),
(660, 'C', '35', '359', '3597', '水资源专用机械制造', '指水利工程管理、节水工程及水的生产、供应专用设备的制造', 1),
(661, 'C', '35', '359', '3599', '其他专用设备制造', '指上述类别中未列明的其他专用设备的制造，包括同位素设备的制造', 1),
(662, 'C', '36', '36', '36', '汽车制造业', '', 1),
(663, 'C', '36', '361', '3610', '汽车整车制造', '指由动力装置驱动，具有四个以上车轮的非轨道、无架线的车辆，并主要用于载送人员和（或）货物，牵引输送人员和（或）货物的车辆制造，还包括汽车发动机的制造', 1),
(664, 'C', '36', '362', '3620', '改装汽车制造', '指利用外购汽车底盘改装各类汽车的制造', 1),
(665, 'C', '36', '363', '3630', '低速载货汽车制造', '指最高时速限制在规定范围内的农用三轮或四轮等载货汽车的制造', 1),
(666, 'C', '36', '364', '3640', '电车制造', '指以电作为动力，以屏板或可控硅方式控制的城市内交通工具和专用交通工具的制造', 1),
(667, 'C', '36', '365', '3650', '汽车车身、挂车制造', '指其设计和技术特性需由汽车牵引，才能正常行驶的一种无动力的道路车辆的制造', 1),
(668, 'C', '36', '366', '3660', '汽车零部件及配件制造', '指机动车辆及其车身的各种零配件的制造', 1),
(669, 'C', '37', '37', '37', '铁路、船舶、航空航天和其他运输设备制造业', '', 1),
(670, 'C', '37', '371', '371', '铁路运输设备制造', '', 1),
(671, 'C', '37', '371', '3711', '铁路机车车辆及动车组制造', '指以外来电源或以蓄电池驱动的，或以压燃式发动机及其他方式驱动的，能够牵引铁路车辆的动力机车、铁路动车组的制造，以及用于运送旅客和用以装运货物的客车、货车及其他铁路专用车辆的制造', 1),
(672, 'C', '37', '371', '3712', '窄轨机车车辆制造', '指可用于交通运输的窄轨内燃机车、电力机车和窄轨非机动车的制造', 1),
(673, 'C', '37', '371', '3713', '铁路机车车辆配件制造', '指铁道或有轨机车及其拖拽车辆的专用零配件的制造', 1),
(674, 'C', '37', '371', '3714', '铁路专用设备及器材、配件制造', '指铁路安全或交通控制设备的制造，以及其他铁路专用设备及器材、配件的制造', 1),
(675, 'C', '37', '371', '3719', '其他铁路运输设备制造', '', 1),
(676, 'C', '37', '372', '3720', '城市轨道交通设备制造', '', 1),
(677, 'C', '37', '373', '373', '船舶及相关装置制造', '', 1);
INSERT INTO `setup_industry` (`id`, `kind`, `big_code`, `mid_code`, `small_code`, `msg`, `remark`, `online`) VALUES
(678, 'C', '37', '373', '3731', '金属船舶制造', '指以钢质、铝质等各种金属为主要材料，为民用或军事部门建造远洋、近海或内陆河湖的金属船舶的制造', 1),
(679, 'C', '37', '373', '3732', '非金属船舶制造', '指以各种木材、水泥、玻璃钢等非金属材料，为民用或军事部门建造船舶的活动', 1),
(680, 'C', '37', '373', '3733', '娱乐船和运动船制造', '指游艇和用于娱乐或运动的其他船只的制造', 1),
(681, 'C', '37', '373', '3734', '船用配套设备制造', '指船用主机、辅机设备的制造', 1),
(682, 'C', '37', '373', '3735', '船舶改装与拆除', '', 1),
(683, 'C', '37', '373', '3739', '航标器材及其他相关装置制造', '指用于航标的各种器材，以及不以航行为主的船只的制造，不含海上浮动装置的制造', 1),
(684, 'C', '37', '374', '374', '航空、航天器及设备制造', '', 1),
(685, 'C', '37', '374', '3741', '飞机制造', '指在大气同温层以内飞行的用于运货或载客，用于国防，以及用于体育运动或其他用途的各种飞机及其零件的制造，包括飞机发动机的制造', 1),
(686, 'C', '37', '374', '3742', '航天器制造', '', 1),
(687, 'C', '37', '374', '3743', '航空、航天相关设备制造', '', 1),
(688, 'C', '37', '374', '3749', '其他航空航天器制造', '', 1),
(689, 'C', '37', '375', '375', '摩托车制造', '', 1),
(690, 'C', '37', '375', '3751', '摩托车整车制造', '指不论是否装有边斗的摩托车制造，包括摩托车发动机的制造', 1),
(691, 'C', '37', '375', '3752', '摩托车零部件及配件制造', '', 1),
(692, 'C', '37', '376', '376', '自行车制造', '', 1),
(693, 'C', '37', '376', '3761', '脚踏自行车及残疾人座车制造', '指未装马达，主要以脚蹬驱动，装有一个或多个轮子的脚踏车辆、残疾人座车及其零件的制造', 1),
(694, 'C', '37', '376', '3762', '助动自行车制造', '指主要以蓄电池作为辅助能源，具有两个车轮，能实现人力骑行、电动或电动助力功能的特种自行车及其零件的制造', 1),
(695, 'C', '37', '377', '3770', '非公路休闲车及零配件制造', '指运动休闲车（不含跑车、山地车和越野车）、四轮休闲车、草地车、观光车等的制造', 1),
(696, 'C', '37', '379', '379', '潜水救捞及其他未列明运输设备制造', '', 1),
(697, 'C', '37', '379', '3791', '潜水及水下救捞装备制造', '指潜水装置及水下作业、救捞装备的制造', 1),
(698, 'C', '37', '379', '3799', '其他未列明运输设备制造', '指手推车辆、牲畜牵引车辆的制造，以及上述未列明的交通运输设备的制造', 1),
(699, 'C', '38', '38', '38', '电气机械和器材制造业 ', '', 1),
(700, 'C', '38', '381', '381', '电机制造', '', 1),
(701, 'C', '38', '381', '3811', '发电机及发电机组制造', '指发电机及其辅助装置、发电成套设备的制造', 1),
(702, 'C', '38', '381', '3812', '电动机制造', '指交流或直流电动机及零件的制造', 1),
(703, 'C', '38', '381', '3819', '微电机及其他电机制造', '指自动化系统中一种主要用于传递和交换信号等方面的元件，即控制微电机的制造，以及其他未列明的电机制造', 1),
(704, 'C', '38', '382', '382', '输配电及控制设备制造', '', 1),
(705, 'C', '38', '382', '3821', '变压器、整流器和电感器制造', '指变压器、静止式变流器等电力电子设备和互感器的制造', 1),
(706, 'C', '38', '382', '3822', '电容器及其配套设备制造', '指电力电容器及其配套装置和电容器零件的制造', 1),
(707, 'C', '38', '382', '3823', '配电开关控制设备制造', '指用于电压超过1000V的，诸如一般在配电系统中使用的接通及断开或保护电路的电器，以及用于电压不超过1000V的，如在住房、工业设备或家用电器中使用的配电开关控制设备及其零件的制造', 1),
(708, 'C', '38', '382', '3824', '电力电子元器件制造', '指用于电能变换和控制（从而实现运动控制）的电子元器件的制造', 1),
(709, 'C', '38', '382', '3825', '光伏设备及元器件制造', '指太阳能组件（太阳能电池）、控制设备及其他太阳能设备和元器件制造；不包括太阳能用蓄电池制造', 1),
(710, 'C', '38', '382', '3829', '其他输配电及控制设备制造', '指开关设备和控制设备内部的元器件之间，以及与外部电路之间的电连接所需用的器件和配件的制造', 1),
(711, 'C', '38', '383', '383', '电线、电缆、光缆及电工器材制造', '', 1),
(712, 'C', '38', '383', '3831', '电线、电缆制造', '指在电力输配、电能传送，声音、文字、图像等信息传播，以及照明等各方面所使用的电线电缆的制造', 1),
(713, 'C', '38', '383', '3832', '光纤、光缆制造', '指将电的信号变成光的信号，进行声音、文字、图像等信息传输的光缆、光纤的制造', 1),
(714, 'C', '38', '383', '3833', '绝缘制品制造', '指电气绝缘子、电机或电气设备用的绝缘零件，以及带有绝缘材料的金属制电导管及接头的制造，但不包括玻璃、陶瓷绝缘体和绝缘漆制品的制造', 1),
(715, 'C', '38', '383', '3839', '其他电工器材制造', '', 1),
(716, 'C', '38', '384', '384', '电池制造', '指以正极活性材料、负极活性材料，配合电介质，以密封式结构制成的，并具有一定公称电压和额定容量的化学电源的制造；包括一次性、不可充电和二次可充电，重复使用的干电池、蓄电池（含太阳能用蓄电池）的制造，以及利用氢与氧的合成转换成电能的装置，即燃料电池制造；不包括利用太阳光转换成电能的太阳能电池制造', 1),
(717, 'C', '38', '384', '3841', '锂离子电池制造', '指以锂离子嵌入化合物为正极材料电池的制造', 1),
(718, 'C', '38', '384', '3842', '镍氢电池制造', '以储氢合金为负极材料，氢氧化镍为正极材料，电解液是含氢氧化锂（LiOH）的氢氧化钾（KOH）水溶液的电池的制造', 1),
(719, 'C', '38', '384', '3849', '其他电池制造', '', 1),
(720, 'C', '38', '385', '385', '家用电力器具制造', '指使用交流电源或电池的各种家用电器的制造', 1),
(721, 'C', '38', '385', '3851', '家用制冷电器具制造', '', 1),
(722, 'C', '38', '385', '3852', '家用空气调节器制造', '指使用交流电源(制冷量14000W及以下)，调节室内温度、湿度、气流速度和空气洁净度的房间空气调节器的制造', 1),
(723, 'C', '38', '385', '3853', '家用通风电器具制造', '指由单相交流电动机驱动扇叶旋转，产生强制气流，以改善人体与周围空气间的热交换条件的电器制造', 1),
(724, 'C', '38', '385', '3854', '家用厨房电器具制造', '指家庭厨房用的电热蒸煮器具、电热烘烤器具、电热水和饮料加热器具、电热煎炒器具、家用电灶、家用食品加工电器具、家用厨房电清洁器具等电器具的制造', 1),
(725, 'C', '38', '385', '3855', '家用清洁卫生电器具制造', '指家用洗衣机、吸尘器等电力器具的制造', 1),
(726, 'C', '38', '385', '3856', '家用美容、保健电器具制造', '', 1),
(727, 'C', '38', '385', '3857', '家用电力器具专用配件制造', '指家用电力器具专用配件的制造，不包括通用零部件制造', 1),
(728, 'C', '38', '385', '3859', '其他家用电力器具制造', '', 1),
(729, 'C', '38', '386', '386', '非电力家用器具制造', '', 1),
(730, 'C', '38', '386', '3861', '燃气、太阳能及类似能源家用器具制造', '指以液化气、天然气、人工煤气、沼气或太阳能作燃料，以马口铁、搪瓷、不锈钢等为材料加工制成的家用器具的生产活动', 1),
(731, 'C', '38', '386', '3869', '其他非电力家用器具制造', '', 1),
(732, 'C', '38', '387', '387', '照明器具制造', '', 1),
(733, 'C', '38', '387', '3871', '电光源制造', '电光源也称灯泡或电灯，本类是指将电能转变为光的器件的制造；目前按发光原理可分为白炽灯（指因电流通过使钨丝白炽而发光的灯）和气体放电灯（指电流通过灯两端的电极形成气体放电而产生光的灯）', 1),
(734, 'C', '38', '387', '3872', '照明灯具制造', '指由起支撑、固定反射和保护作用的部件及联结光源所必须的电路辅助装置组合而成，将一个或多个光源发出的光进行控制分配或反射装置的制造；包括建筑物照明、道路照明、运输设备照明、生产照明、舞台照明等各种灯具的制造', 1),
(735, 'C', '38', '387', '3879', '灯用电器附件及其他照明器具制造', '指灯用电器附件，以及为各种灯泡配套用的灯座及其他照明器具的制造  ', 1),
(736, 'C', '38', '389', '389', '其他电气机械及器材制造', '', 1),
(737, 'C', '38', '389', '3891', '电气信号设备装置制造', '指交通运输工具（如机动车、船舶、铁道车辆等）专用信号装置及各种电气音响或视觉报警、警告、指示装置的制造，以及其他电气声像信号装置的制造', 1),
(738, 'C', '38', '389', '3899', '其他未列明电气机械及器材制造', '指上述未列明的电气机械及器材的制造', 1),
(739, 'C', '39', '39', '39', '计算机、通信和其他电子设备制造业', '', 1),
(740, 'C', '39', '391', '391', '计算机制造', '', 1),
(741, 'C', '39', '391', '3911', '计算机整机制造', '指将可进行算术或逻辑运算的中央处理器和外围设备集成计算整机的制造，也包括硬件与软件集成计算机系统的制造，还包括来件组装计算机的加工', 1),
(742, 'C', '39', '391', '3912', '计算机零部件制造', '指组成电子计算机的内存、板卡、硬盘、电源、机箱、显示器等部件的制造', 1),
(743, 'C', '39', '391', '3913', '计算机外围设备制造', '指计算机外围设备及附属设备的制造；包括输入设备、输出设备和外存储设备等的制造', 1),
(744, 'C', '39', '391', '3919', '其他计算机制造', '指计算机应用电子设备（以中央处理器为核心，配以专业功能模块、外围设备等构成各行业应用领域专用的电子产品及设备，如金融电子、汽车电子、医疗电子、工业控制计算机及装置、信息采集及识别设备、数字化3C产品等）、信息安全设备（用于保护网络和计算机中信息和数据安全的专用设备，包括边界安全、通信安全、身份鉴别与访问控制、数据安全、基础平台、内容安全、评估审计与监控、安全应用设备等），以及其他未列明计算机设备的制造', 1),
(745, 'C', '39', '392', '392', '通信设备制造', '', 1),
(746, 'C', '39', '392', '3921', '通信系统设备制造', '指固定或移动通信接入、传输、交换设备等通信系统建设所需设备的制造', 1),
(747, 'C', '39', '392', '3922', '通信终端设备制造', '指固定或移动通信终端设备的制造', 1),
(748, 'C', '39', '393', '393', '广播电视设备制造', '', 1),
