INSERT INTO `setup_industry` (`id`, `kind`, `big_code`, `mid_code`, `small_code`, `msg`, `remark`, `online`) VALUES
(1079, 'I', '64', '641', '6410', '互联网接入及相关服务', '指除基础电信运营商外，基于基础传输网络为存储数据、数据处理及相关活动，提供接入互联网的有关应用设施的服务', 1),
(1080, 'I', '64', '642', '6420', '互联网信息服务', '指除基础电信运营商外，通过互联网提供在线信息、电子邮箱、数据检索、网络游戏等信息服务', 1),
(1081, 'I', '64', '649', '6490', '其他互联网服务', '指除基础电信运营商服务、互联网接入及相关服务、互联网信息服务以外的其他未列明互联网服务', 1),
(1082, 'I', '65', '65', '65', '软件和信息技术服务业', '指对信息传输、信息制作、信息提供和信息接收过程中产生的技术问题或技术需求所提供的服务 ', 1),
(1083, 'I', '65', '651', '6510', '软件开发', '指为用户提供计算机软件、信息系统或者设备中嵌入的软件，或者在系统集成、应用服务等技术服务时提供软件的开发和经营活动；包括基础软件、支撑软件、应用软件、嵌入式软件、信息安全软件、计算机（应用）系统、工业软件以及其他软件的开发和经营活动', 1),
(1084, 'I', '65', '652', '6520', '信息系统集成服务', '指基于需方业务需求进行的信息系统需求分析和系统设计，并通过结构化的综合布缆系统、计算机网络技术和软件技术，将各个分离的设备、功能和信息等集成到相互关联的、统一和协调的系统之中，以及为信息系统的正常运行提供支持的服务；包括信息系统设计、集成实施、运行维护等服务', 1),
(1085, 'I', '65', '653', '6530', '信息技术咨询服务', '指在信息资源开发利用、工程建设、人员培训、管理体系建设、技术支撑等方面向需方提供的管理或技术咨询评估服务；包括信息化规划、信息技术管理咨询、信息系统工程监理、测试评估、信息技术培训等', 1),
(1086, 'I', '65', '654', '6540', '数据处理和存储服务', '指供方向需方提供的信息和数据的分析、整理、计算、编辑、存储等加工处理服务，以及应用软件、业务运营平台、信息系统基础设施等的租用服务；包括各种数据库活动、网站内容更新、数据备份服务、数据存储服务、在线企业资源规划（ERP）、在线杀毒、电子商务平台、物流信息服务平台、服务器托管、虚拟主机等', 1),
(1087, 'I', '65', '655', '6550', '集成电路设计', '指IC设计服务，即企业开展的集成电路功能研发、设计等服务', 1),
(1088, 'I', '65', '659', '659', '其他信息技术服务业', '', 1),
(1089, 'I', '65', '659', '6591', '数字内容服务', '指数字内容的加工处理，即将图片、文字、视频、音频等信息内容运用数字化技术进行加工处理并整合应用的服务', 1),
(1090, 'I', '65', '659', '6592', '呼叫中心', '指受企事业单位委托，利用与公用电话网或因特网连接的呼叫中心系统和数据库技术，经过信息采集、加工、存储等建立信息库，通过固定网、移动网或因特网等公众通信网络向用户提供有关该企事业单位的业务咨询、信息咨询和数据查询等服务', 1),
(1091, 'I', '65', '659', '6599', '其他未列明信息技术服务业', '', 1),
