(1094, 'J', '66', '661', '6610', '中央银行服务', '指代表政府管理金融活动，并制定和执行货币政策，维护金融稳定，管理金融市场的特殊金融机构的活动', 1),
(1095, 'J', '66', '662', '6620', '货币银行服务', '指除中央银行以外的各类银行所从事存款、贷款和信用卡等货币媒介活动，还包括在中国开展货币业务的外资银行及分支机构的活动', 1),
