(1100, 'J', '66', '663', '6639', '其他非货币银行服务', '指上述未包括的从事融资、抵押等非货币银行的服务，包括小额贷款公司、农村合作基金会等融资活动，以及各种消费信贷、国际贸易融资、公积金房屋信贷、抵押顾问和经纪人的活动                                                                                                                                         ', 1),
