(1105, 'J', '67', '671', '6712', '证券经纪交易服务', '指在金融市场上代他人进行交易、代理发行证券和其他有关活动，包括证券经纪、证券承销与保荐、融资融券业务、客户资产管理业务等活动', 1),
(1106, 'J', '67', '671', '671', '', '', 1),
