(1113, 'J', '67', '679', '6790', '其他资本市场服务', '指投资咨询服务、财务咨询服务、资信评级服务，以及其他未列明的资本市场的服务', 1),
(1114, 'J', '68', '68', '68', '保险业', '', 1),
(1115, 'J', '68', '681', '681', '人身保险', '指以人的寿命和身体为保险标的的保险活动，包括人寿保险、健康保险和意外伤害保险', 1),
(1116, 'J', '68', '681', '6811', '人寿保险', '指普通寿险、分红寿险、万能寿险、投资连结保险等活动(不论是否带有实质性的储蓄成分)', 1),
