(1118, 'J', '68', '682', '6820', '财产保险', '指除人身保险外的保险活动，包括财产损失保险、责任保险、信用保险、保证保险等', 1),
(1119, 'J', '68', '683', '6830', '再保险', '指承担与其他保险公司承保的现有保单相关的所有或部分风险的活动', 1),
(1120, 'J', '68', '684', '6840', '养老金', '指专为单位雇员或成员提供退休金补贴而设立的法定实体的活动(如基金、计划和/或项目等)，包括养老金定额补贴计划以及完全根据成员贡献确定补贴数额的个人养老金计划等', 1),
(1121, 'J', '68', '685', '6850', '保险经纪与代理服务', '指保险代理人和经纪人进行的年金、保单和分保单的销售、谈判或促合活动', 1),
